import React from 'react';

const PopUp = ({openPopUp}) => {
    console.log("POP");
    const handleClose =() =>{
        openPopUp=false;
    }
    return (  
        <Dialog open={openPopUp}>
            <DialogTitle>
                I AM TITLE
            </DialogTitle>
            <DialogActions>
          <Button autoFocus onClick={handleClose} color="primary">
            Disagree
          </Button>
          <Button onClick={handleClose} color="primary" autoFocus>
            Agree
          </Button>
        </DialogActions>
        </Dialog>
    );
}

export default PopUp;
